"    var isUserXConfigured;
    var isUserXProcessing;
    var userXProcessingTimeout;

    var timeoutUserX;

    function startProcessingUserX() {
        isUserXProcessing = true;
        setTimeoutUserX();
    }

    function stopProcessingUserX() {
        isUserXProcessing = false;
    }

    function setTimeoutUserX() {
        resetTimeoutUserX();
        userXProcessingTimeout = setTimeout(stopProcessingUserX, timeoutUserX);
    }

    function resetTimeoutUserX() {
        if (userXProcessingTimeout) {
            clearTimeout(userXProcessingTimeout);
        }
    }

    function configUserX() {
        if (!timeoutUserX) {
            timeoutUserX = 350;
        }
        isUserXProcessing = false;
        resetTimeoutUserX();
        configUserXScroll();
        configUserXFocus();
        isUserXConfigured = true;
    }

    function configUserXScroll() {
        window.onscroll = startProcessingUserX;
    }

    function configUserXFocus() {
        let focusable = document.querySelectorAll('button, [href], input, select, textarea, [tabindex]:not([tabindex="-1"])');
        let count = focusable.length;
        for (var i = 0; i < count; i++) {
            focusable[i].onfocus = startProcessingUserX;
            focusable[i].onblur = startProcessingUserX;
        }
    }

    function isStateInvalid() {
        return window.document.readyState != 'complete';
    }


    function sensitiveBounds() {
        //let extFrames = [];
        //document.querySelectorAll('iframe').forEach(function(frame) {
        //    try {
        //        let doc = iframe.contentDocument;
        //    } catch(e) {
        //        extFrames.push(frame);
        //    }
        //});

        if (isStateInvalid()) {
            return 'not ready'
        }

        if (!isUserXConfigured) {
            configUserX();
        }

        if (isUserXProcessing) {
            return 'processing';
        }

        let filter = '%@';
        let components = document.querySelectorAll(filter);

        let count = components.length;
        if (count <= 0) {
            return '[]';
        }

        let viewWidth = %f;
        let viewHeight = %f;
        let xOffset = %f;
        let yOffset = %f;
        let scale = %f;

        var rects = [];
        for (var i = 0; i < count; i++) {
            let rect = components[i].getBoundingClientRect();
            if (rect.width <= 0 || rect.height <= 0) {
                continue;
            }

            let x = rect.left * scale + xOffset;
            let y = rect.top * scale + yOffset;
            let width = rect.width * scale;
            let height = rect.height * scale;

            if (viewWidth > x &&
                viewHeight > y &&
                y + height > 0 &&
                x + width > 0) {
                rects.push([ [x, y], [width, height] ]);
            }
        }
        return JSON.stringify(rects);
    }
    sensitiveBounds();"
